function findDifferences(obj1, obj2) {
  let differences = [];

  for (let key in obj1) {
    if (JSON.stringify(obj1[key]) !== JSON.stringify(obj2[key])) {
      differences.push({
        isDifferent: true,
        difference: key,
        oldValue: obj2[key],
        newValue: obj1[key]
      });
    }
  }

  // Check for keys in obj2 that are not in obj1
  for (let key in obj2) {
    if (!(key in obj1)) {
      differences.push({
        isDifferent: true,
        difference: key,
        oldValue: obj2[key],
        newValue: undefined
      });
    }
  }

  return differences;
}

// Assuming the JSON objects are in $('Properties - Updated Record').all()[0].json.body
const newObject = $('Properties - Updated Record').all()[0].json.body.record;
const oldObject = $('Properties - Updated Record').all()[0].json.body.old_record;

const differences = findDifferences(newObject, oldObject);

// Set the output to be an array of difference objects
items = differences.map(diff => ({ json: diff }));

return items;
